import React from "react";
import { useHistory } from "react-router-dom";
export const Login = () => {
  const history = useHistory();
  const handleSubmit = () => {
    history.push("/admin");
  };
  return (
    <>
      <div>
        Login
        <button onSubmit={handleSubmit}>Submit</button>
      </div>
    </>
  );
};
